  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This release contains the Basic Stand
  Alone (BSA) Outpatient Procedures Public Use Files (PUF) with information from Medicare
  outpatient claims. The CMS BSA Outpatient Procedures PUF is a procedure-level file
  in which each record is a procedure in an outpatient claim incurred by a 5 percent
  sample of Medicare beneficiaries. There are some demographic and claim-related variables
  provided in this PUF as detailed below. However, as claim or beneficiary identities
  are not provided, it is not possible to link procedures that belong to the same
  claim or beneficiary.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
